"""# Define Training Pipeline (Update Me)

At the moment, Annotation Lab only supports updating embeddings used and stages in pipeline. This is the section where you can modify the way you define training pipeline.
"""

# Imports needed for setting up the custom pipeline
from sparknlp.base import *
from sparknlp_jsl.annotator import *
from sparknlp.annotator import WordEmbeddingsModel

from pathlib import Path

TF_GRAPH_DIR = str(Path().home().joinpath("tf_graph"))
LOG_DIR = str(Path().home().joinpath("logs"))

embeddings = (
    WordEmbeddingsModel.pretrained("embeddings_clinical", "en", "clinical/models")
    .setInputCols(["sentence", "token"])
    .setOutputCol("embeddings")
)

def get_pipeline():

    ner_tagger = (
        MedicalNerApproach()
        .setInputCols(["sentence", "token", "embeddings"])
        .setOutputCol("ner")
        .setLabelColumn("label")
        .setDropout(0.5)
        .setValidationSplit(0.2)
        .setRandomSeed(0)
        .setMaxEpochs(3)
        .setVerbose(1)
        .setEvaluationLogExtended(True)
        .setEnableOutputLogs(True)
        .setIncludeConfidence(True)
        .setGraphFolder(TF_GRAPH_DIR) # Do not remove/modify this; ALab needs defined location to store TF graphs
        .setOutputLogsPath(LOG_DIR) # Do not remove/modify this; ALab needs defined location to store logs
    )
    return Pipeline(stages=[embeddings, ner_tagger]), embeddings

